										viewPath.pop();
										oFrm.action =  "./generic.do?viewName=" + viewPath.join("/") + "/" + itemName + "&backgroundColor=FFF&isSubFrame=Y";;
										oFrm.method = "post";
										oFrm.target = frameId;
										frameDom.show();
										var parentFrameName = "${param.frameName}";
